import React from 'react';
import './about.scss';

const About = () => {
  return (
    <div>
        <div className="container">
            <div className="abt-left">
                <p>Hima Madhu</p>
                <p>Front-end Developer</p>
                <p>Designing the web's future, pixel by pixel, with passion and precision.</p>
            </div>
            <div className="abt-right">

            </div>
        </div>
      
    </div>
  )
}

export default About
